stage:
  externalfiles:
  - url: https://blackfire.io/api/v1/releases/probe/php/linux/amd64/72
    compressed: true
    pattern: blackfire-*.so
    destination: /usr/local/lib/php/extensions/no-debug-non-zts-20180731/blackfire.so
    checksum: ""
    mode: 420
    owner: ""
  systempackages:
    git: '*'
    libicu-dev: '*'
    libpcre3-dev: '*'
    libpq-dev: '*'
    libxml2-dev: '*'
    libzip-dev: '*'
    unzip: '*'
    zlib1g-dev: '*'
  fpm: true
  command: null
  extensions:
    apcu: 5.1.17
    ctype: '*'
    date: '*'
    dom: '*'
    hash: '*'
    iconv: '*'
    intl: '*'
    json: '*'
    mbstring: '*'
    openssl: '*'
    pcre: '*'
    pdo: '*'
    pdo_pgsql: '*'
    spl: '*'
    tokenizer: '*'
    xml: '*'
    xmlwriter: '*'
    zip: '*'
  globaldeps:
    symfony/flex: '*'
  configfiles:
    inifile: docker/php/php.ini
    fpmconfigfile: null
  composerdumpflags:
    apcu: false
    classmapauthoritative: true
  sources:
  - bin/console
  - config/
  - fixtures/
  - public/
  - src/
  integrations:
  - blackfire
  statefuldirs:
  - var/
  healthcheck: null
  postinstall:
  - echo '<?php return [];' > .env.local.php
  - APP_ENV=prod composer run-script --no-dev post-install-cmd
